// src/pages/AdminDashboard.js
import React from 'react';
import { Link } from 'react-router-dom';

const AdminDashboard = () => {
  return (
    <div className="max-w-2xl mx-auto mt-12 bg-white p-8 rounded-lg shadow-md">
      <h1 className="text-4xl font-bold mb-6">Admin Dashboard</h1>
      <p className="text-xl mb-4">Welcome, Admin!</p>
      <ul className="list-disc list-inside space-y-2 text-blue-600">
        <li><Link to="/car-review">Review and approve car submissions</Link></li>
        <li><Link to="/manage-users">Manage users</Link></li>
        <li><Link to="/stats">View system statistics</Link></li>
      </ul>
    </div>
  );
};

export default AdminDashboard;
